contract AAiTElection {
    enum DEPTARTMENT_TYPE {
        BIOMED,
        CHEMICAL,
        CIVIL,
        ELEC,
        MECHANICAL,
        SITE
    }
    enum ELECTION_TYPE {
        PENDING,
        ONGOING,
        COMPLETED
    }
    enum PHASE_NAME {
        REGISTRATION,
        REGISTRATION_BREAK,
        SECTION_ELECTION,
        SECTION_ELECTION_BREAK,
        BATCH_ELECTION,
        BATCH_ELECTION_BREAK,
        DEPARTMENT_ELECTION,
        COMPLETED
    }
    string[] private deptTypes = [
        "Biomedical Engineering",
        "Chemical Engineering",
        "Civil Engineering",
        "Electrical Engineering",
        "Mechanical Engineering",
        "Software Engineering"
    ];

    struct ElectionStruct {
        uint256 index;
        string name;
        ELECTION_TYPE status;
        uint256 startDate;
        uint256 endDate;
        address[] candidates;
        address[] winners;
        uint256 year;
        uint256 section;
        DEPTARTMENT_TYPE department;
    }
    struct ElectionPhase {
        PHASE_NAME phaseName;
        uint256 start;
        uint256 end;
    }

    ElectionPhase public phase;

    event LogCurrentElectionPhase(string currentPhase);

    struct ElectionResultStruct {
        string electionName;
        // string candidateFullName;
        // string candidateLName;
        // string candidateGName;
        address[] candidateAddress;
        // uint256 votes;
    }

    address private immutable owner;
    address[] private voted;
    address[] private blacklist;

