    //     address[] winners,
    //     address[] voters,
    //     address[] voted,
    //     uint256 year,
    //     uint256 section,
    //     DEPTARTMENT_TYPE department
    // );

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    constructor(
        address _AAiTVoteTokenAddress // address _AAiTStudentAddress, // address _AAiTElectionTimerAddress
    ) {
        owner = msg.sender;
        // AAiTVoteTokenAddress = _AAiTVoteTokenAddress;
